import Header from "./components/Header";
import DayList from "./components/DayList";
import Day from "./components/Day";


function App() {
  return (
      <browserRotuer>
        <div className="App">
          <Header />
          <Switch>
              <Route path = "/">
            <DayList />
              </Route>
            <Day />
          </Switch>
        </div>
      </browserRotuer>
  );
}

export default App;
